script: |
  super -f text -I q464.spq | sort > q464.out

inputs:
  - name: q464.spq
    data: |
      SELECT - col2 FROM tab1 (FORMAT parquet) WHERE NOT + ( + - 5 ) * - col2 + + col0 + + + col1 BETWEEN - - col1 AND - 38;
  - name: tab1

outputs:
  - name: q464.out
    data: |
      -59
      -68
      -96
